import React from 'react'
import Footer from '../Footer/Footer'
import { FooterElement } from '../Footer/StyleFooter'

export default function HomePageHamburger() {
  return (
    <div>
        <FooterElement> Restaurants </FooterElement>
        <FooterElement> Chefs </FooterElement>
        <Footer/>
    </div>
  )
}
